import styled from "styled-components";

function SectionAbout() {
  return (
    <Container id="skills">
      <Title>
        <h4>02</h4>
        <h2>Various ways for visual expression</h2>
        <h3>We always think about what could be the best way for visual expressions. We try to explore as many avenues as possible for better visual representation. </h3>
        <ViewBtn>
          <a href="./sub/drawing.php" class="s3ViewBtn">
            VIEW
          </a>
          <span></span>
        </ViewBtn>
      </Title>
      <Wrap>
        <SlideView>
          <SlideWrap>
            <li>
              <ProfileWrap>
                <Left>
                  <ProfileTxt>
                    <h2>PROFILE</h2>
                    <p>Name 김아름</p>
                    <p>서울 마포구 거주</p>
                    <p>1989.03.07 </p>
                    <p>010.2967.5037</p>
                    <p>dkfma0307@naver.com</p>
                  </ProfileTxt>
                </Left>
                <Right>
                  <img src="/img/kim_img.jpg" />
                </Right>
              </ProfileWrap>
            </li>
            <li>
              <div></div>
            </li>
            <li>
              <div></div>
            </li>
          </SlideWrap>
        </SlideView>
        <BtnWrap>
          <li>
            <a href="javascript:" class="s3PageBtn">
              01
            </a>
          </li>
          <li>
            <a href="javascript:" class="s3PageBtn">
              02
            </a>
          </li>
          <li>
            <a href="javascript:" class="s3PageBtn">
              03
            </a>
          </li>
        </BtnWrap>
      </Wrap>
      <BgWrap>
        <Bg></Bg>
      </BgWrap>
    </Container>
  );
}

export default SectionAbout;

const Container = styled.div`
  z-index: 1;
  position: relative;
  top: 0;
  left: 0;
  width: 100%;
  height: 1000px;
  background: #fff;

  @media ${({ theme }) => theme.device.mobile} {
    height: 1000px;
    margin-top: 80px;
  }
`;

const Title = styled.div`
  z-index: 2;
  position: relative;
  width: 100%;
  max-width: 74%;
  margin: 0 auto;
  padding-top: 100px;

  @media ${({ theme }) => theme.device.laptop} {
    z-index: 2;
    position: relative;
    width: 100%;
    max-width: 80%;
    margin: 0 auto;
    padding-top: 100px;
  }
  @media ${({ theme }) => theme.device.tablet} {
    padding-top: 50px;
    transition: all 0.3s;
  }
  @media ${({ theme }) => theme.device.mobile} {
    padding-top: 100px;
    transition: all 0.3s;
    text-align: center;
  }
  h4 {
    font-weight: 500;
    color: #000;
    font-size: 20px;
    @media ${({ theme }) => theme.device.laptop} {
      font-size: 18px;
    }

    @media ${({ theme }) => theme.device.mobile} {
      color: #050505;
      font-size: 18px;
    }
  }
  h2 {
    width: 40%;
    font-family: "Montserrat";
    font-weight: 600;
    color: #000;
    font-size: 60px;
    margin-top: 20px;
    line-height: 120%;
    @media ${({ theme }) => theme.device.laptop} {
      width: 40%;
      font-family: "Montserrat";
      font-weight: 600;
      color: #000;
      font-size: 50px;
      margin-top: 20px;
      line-height: 120%;
    }

    @media ${({ theme }) => theme.device.mobile} {
      width: 100%;
      font-family: "Montserrat";
      font-weight: 600;
      color: #050505;
      font-size: 50px;
      margin-top: 20px;
      line-height: 120%;
    }
  }
  h3 {
    width: 30%;
    font-family: "Montserrat";
    font-weight: 500;
    color: #000;
    font-size: 18px;
    line-height: 160%;
    margin-top: 40px;
    @media ${({ theme }) => theme.device.laptop} {
      width: 30%;
      font-family: "Montserrat";
      font-weight: 500;
      color: #000;
      font-size: 18px;
      line-height: 160%;
      margin-top: 40px;
    }

    @media ${({ theme }) => theme.device.mobile} {
      width: 100%;
      font-family: "Montserrat";
      font-weight: 400;
      color: #050505;
      font-size: 18px;
      line-height: 160%;
      margin-top: 30px;
    }
  }
`;

const Wrap = styled.div`
  z-index: 3;
  position: absolute;
  top: 250px;
  right: 13%;
  width: 44.981608%;
  height: 585px;
  background: #222831;
  @media ${({ theme }) => theme.device.laptop} {
    z-index: 3;
    position: absolute;
    top: 250px;
    right: 10%;
    width: 44.981608%;
    height: 450px;
    background: seagreen;
